import ReactDOM from 'react-dom';
import './style.css';
import MealPlan from './components/MealPlan';
// import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <MealPlan name="Meal Plan!"/>
  </React.StrictMode>,
  document.getElementById('root'),
);

